properties.description:
Milano zona Rubattino, dominante ultimo piano con affacci panoramici, sito all'interno di un contesto signorile di recente costruzione con giardino condominiale e doppio ascensore, La proprietà, in perfetto stile metropolitano, è dotata di ogni comfort: 
-Ultimo piano con due ascensori; 
-Luminosità e affacci panoramici; 
-privata terrazza abitabile angolare;
- finemente arredato su misura; 
-ampia autorimessa nello stabile, di mq 31, idonea per ospitare due auto;
- cantina ciclabile.
L'immobile è ubicato in via Caduti in Missione di Pace n.19, in posizione strategica tra la via Pitteri e la via Rubattino: una location ideale che permette di accedere a tutte le comodità del vivere urbano e godere di una vista sul verde.
